import * as React from 'react';
import { View, Text,TouchableWithoutFeedback } from 'react-native';
import { SettingContext } from '../../context/SettingContext';
import ActionLine from '../../components/ActionLine';
import InforLine from '../../components/InforLine'; 
export default function SettingsScreen({ navigation }) {
    const settings = SettingContext.useContext
    return (
        <>
        <TouchableWithoutFeedback onPress={() => navigation.navigate('Ngôn ngữ')}> 
        <View> 
            <InforLine title="Ngôn ngữ" value={'Tiếng Việt'} stack={true}/>
        </View>
        </TouchableWithoutFeedback>
        
        <TouchableWithoutFeedback onPress={() => navigation.navigate('Profile')}> 
        <View> 
            <ActionLine title="Chế độ" value={1200000}  />
        </View>
        </TouchableWithoutFeedback>
        </>
    );
}
